import './App.css';
import { Container , Home ,} from './compontents/index'
import {BrowserRouter ,Link , Route ,Routes} from 'react-router-dom'
function App() {
  return (
    
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home/>} />
      </Routes>
    
    </BrowserRouter>
    
  
  );
}

export default App;
